import React, {useState} from 'react';
import { StyleSheet, Text, Image, TouchableOpacity, View,TextInput,Button } from 'react-native';
import Loginbtn from '../../components/loginbtn';
import InputData from '../../components/inputData';
import ModuleButton from '../../components/moduleButton';
//import styles from './styles.js';


   
    
   
const Logininput = ({navigation}) => {
    const pressHandler =() =>{
        navigation.navigate('Home');
        
    }
    return(
        <View>
       
        <View style={styles.container}>
        <InputData text='Username' />
        <InputData text='Password' />
        <View style = {styles.Btncontainer}>
        < ModuleButton text = 'Login'/>
        
        </View>
        
        <Text style={styles.suggest}>New Ambulancea? </Text>
        </View>


        </View>

        

    )
}
const styles = StyleSheet.create({
    Btncontainer:{
        flexDirection:'row',
        justifyContent: 'space-between',
        alignItems:'center',
    },
    Image:{
        
        paddingTop:20,
        margin:50,
        height:350,
        width:'auto',
    },
  container:{
    marginTop:60,
  },
  suggest:{
    marginTop:10,
    textAlign:'center',
    color:'grey',
    fontSize:12,
  },
})
export default Logininput
